  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Upper
  Mississippi River Wildlife and Fish Refuge outlines Refuge accomplishments during
  the 1984 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management planning, and public participation.
  Refuge administration is outlined; information about personnel, other manpower programs,
  volunteer programs, and funding is given. Habitat management is also covered; subjects
  include wetlands, forests, grasslands, grazing, and fire management. The wildlife
  section of the report discusses wildlife diversity, endangered and threatened species,
  waterfowl, marsh birds and waterbirds, shorebirds, raptors, other migratory birds,
  game mammals, and marking and bird banding. The public uses of the Refuge described
  in this report include hunting, trapping, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, rehabilitation,
  major maintenance, equipment utilization and replacement, and communication systems.
  Items of interest are provided at the end. Refuge brochures and newspaper articles
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
